   [72]={next_id=73, abreast_id={}, pType =1, cg_type =10, dialog=1, msg="在我活过的这上百年里，一切都是灰白的，我走的每一步，都被天兆之星安排好。", msg_color="", msg_size=0, talker="", audio="", img="", video_url="", music_id="0", background_music="", model_tid={}, model_pos={}, model_move_pos={}, model_exit={}, model_show_effect={}, page_show_effect={ 0.20, 0, 0, 0, 0.00, 0.00, 0.00, 0.00, 713.00, 341.00, 1.00, {}, {}}, update_model={}, role_act={}, head_path="", shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
